    this.state = {
       linkedin:[],
    }
  }
  componentDidMount() {
    const options = {
      email:"wjswogus0007@gmail.com",
      password:"Jh110455!"
    }
    scrapedin(options)
    .then((profileScraper) => profileScraper('https://www.linkedin.com/in/yjkim/',500))
    .then((profile) => this.setState({linkedin: [profile]}));
  }
